@bonifacemwangi’s answer really touched me when I moderated an @IDAOrg panel with the filmmakers and subjects of @SoftieTheFilm. Softie is one of a few African directed and produced documentaries in contention for the Academy Award for Best Documentary Feature and I am honored to cheer them on! 

Softie is available to view in Kenya, Nigeria, South Africa, Tanzania, Uganda, US, UK and Canada. Find out how you can watch at SoftieTheFilm.com/watch.

